"use strict";
class Topic {
    constructor(description, display_name, domain, field, id, ids, keywords, subfield, updated_date, works_count) {
        this.description = description;
        this.display_name = display_name;
        this.domain = domain;
        this.field = field;
        this.id = id;
        this.ids = ids;
        this.keywords = keywords;
        this.subfield = subfield;
        this.updated_date = updated_date;
        this.works_count = works_count;
    }
}
